import {
  Container,
  Row,
  Col,
  Alert,
  Breadcrumb,
  BreadcrumbItem,
  Card,
  CardHeader,
  CardTitle,
  CardImg,
  CardBody,
  CardFooter,
  Button
} from "shards-react";
import Img from "react-image";
import Head from "next/head";

// Home components
import HomeCarousel from "../home/HomeCarousel";
import Marketing from "../home/Marketing";
import MailingListSubscribe from "../home/MailingListSubscribe";

// Layout
import Layout from "../components/Layout";
import Message from "../common/Message";

function Listening({ statusCode }) {
  return (
    <Layout>
      <Container>
        <SEO
          title="Listening Exercises | CXC Spanish Online"
          description={"Practice listening with our "}
          pathname={"https://www.cxcspanish.com/listening"}
          siteLanguage={"en"}
          siteLocale={""}
          twitterUsername={"_rxheem"}
        />

        <Breadcrumb>
          <BreadcrumbItem>
            <a href="/">Home</a>
          </BreadcrumbItem>
          <BreadcrumbItem active>Listening Exercises</BreadcrumbItem>
        </Breadcrumb>
      </Container>
    </Layout>
  );
}

Error.getInitialProps = ({ res, err }) => {
  const statusCode = res ? res.statusCode : err ? err.statusCode : 404;
  return { statusCode };
};

export default Listening;
